import React from "react";
import styled from "styled-components";

// cover video styled components

const VideoContainer = styled.section`
  width: 100%;
  height: 100vh;
  position: relative;

`;

const CoverVideo = () => {
  return <VideoContainer>CoverVideo</VideoContainer>;
};

export default CoverVideo;
